INSERT INTO `pages` (`id`, `name`, `slug`, `s_description`, `priority`, `description`, `created_at`, `updated_at`) VALUES
(1, 'About Us', 'about-us', 'In a period of artificial intelligence and humanizing technology.ECL has been able to develop hi-end security solutions for the operations of the clients.', 7, '<p class=\"title-color\"><strong>About</strong></p>\r\n\r\n<p>ECL Systems Ltd. is a fast growing IT and Security Solutions entity. We have a vision to equip clients with the state of solution system for a smoother operation and help vanquish competition. Presently, ECL is working alongside with high profile clients from the private and public sector industries, bringing together leading brands in creating customized solutions to meet the demands of individual businesses. ECL designs, plans and implements system integrations with cutting edge technology that is steps ahead of its rivals to help clients monitor, control and record their business operations at all times.</p>\r\n\r\n<p class=\"title-color\"><strong>History</strong></p>\r\n\r\n<p>ECL Systems Ltd. was established in 2015, originated by providing IT and security solutions to mid-level and small scale businesses. The aim of ECL since then has been to provide quality solutions that help in creating a trusted list of clients. In 2016, ECL began to expand the scale of operation by strengthening its customer base and with steady growth; ECL soon became a competitive firm in the industry attracting high profile clients with diversified needs.</p>\r\n\r\n<p>The projects that ECL completed were not only successful but were also able to attract clients with the level of design and high quality implementation of these projects. From a small scale solution provider, ECL was growing rapidly with the intent of becoming a good solution provider for quality and trusted system solutions.</p>\r\n\r\n<p class=\"title-color\"><strong>What we do</strong></p>\r\n\r\n<p>We at ECL, create positive solutions, integrating hi-tech security solutions in the hands of skilled and trained professionals to produce a service above and beyond its opponents. ECL has confidence in delivering a customized solution with the highest quality of service in all aspects of its business operations.</p>\r\n\r\n<p>ECL has three Divisions of operations:</p>\r\n\r\n<ul>\r\n	<li>Business and Security Solutions</li>\r\n	<li>Data Center design, implementation &amp; commission</li>\r\n	<li>Networking &amp; Training</li>\r\n</ul>\r\n\r\n<p>We pride ourselves in being the best at what we do, the services we provide, the products we use, the clients we serve and the employees we hire.</p>\r\n\r\n<p class=\"title-color\"><strong>Our Areas of Expertise:</strong></p>\r\n\r\n<p><strong>Consultancy Service</strong><br />\r\nAdvising clients on the most fitting solutions for their specific scenario.</p>\r\n\r\n<p><strong>Project Design and Implementation&nbsp;</strong><br />\r\nCreating Innovative Solutions and Executing the Design.</p>\r\n\r\n<p><strong>Project Management Planning&nbsp;</strong><br />\r\nControlling and executing the work of clients to meet specific criteria.&nbsp;</p>\r\n\r\n<p><strong>Turnkey Solutions</strong>&nbsp;<br />\r\nOff the Shelf Solutions to satisfy clients with detailed requirements.&nbsp;</p>\r\n\r\n<p><strong>Maintenance Services&nbsp;</strong><br />\r\nProviding clients with sustainable services to achieve a secured security system.&nbsp;</p>', '2018-07-28 06:58:43', '2019-02-13 05:51:48');
INSERT INTO `pages` (`id`, `name`, `slug`, `s_description`, `priority`, `description`, `created_at`, `updated_at`) VALUES
(4, 'Management Profile', 'management-profile', NULL, NULL, '<h2>ORGANOGRAM OF ECL SYSTEM Ltd</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"height:534px; width:978px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2018-07-28 07:55:47', '2018-09-26 02:58:20');
INSERT INTO `pages` (`id`, `name`, `slug`, `s_description`, `priority`, `description`, `created_at`, `updated_at`) VALUES
(5, 'Partners', 'partners', 'Since our inception', NULL, '<p>Since our inception, our alliances have played a critical role in our drive for ecosystem-based innovation. Our service offerings and solutions across industry verticals are strengthened by alliances with global technology vendors, customers, and niche solution providers. And ECL helps its alliance partners with several International menufecturer and Technology Inventors.&nbsp;Knowing partners and their technology inside-out, we can rapidly tailor solutions to meet clients&rsquo; specific needs. We share best practices and collaborate on development with technology providers to help clients innovate and enhance performance.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"float:left; height:120px; margin-left:30px; margin-right:30px; width:281px\" /><strong>Avi Networks </strong>completes enterprises&rsquo; digital transformation with its intent-based application services. The Avi Vantage Platform, consisting of a Software Load Balancer, Intelligent WAF, and Elastic Service Mesh, is deployed across data centers and clouds, delivering better elasticity and intelligence. Customers enjoy 5X faster application rollouts, actionable analytics, and 50% lower cost.<a href=\"http://www.avinetworks.com\">Click</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<img src=\"data:image/png;base64,\" style=\"float:right; height:85px; margin-left:30px; margin-right:30px; width:384px\" /><strong>Paladion</strong> is a robust managed security service provider, with over a decade of experience, trusted by organizations from around the globe from Asia to the US to EMEA. Currently, they are actively servicing more than 700 satisfied clients while continuing to truly transform customer experience, with IT security as our top priority. <strong>Paladion</strong> assists its Partners to improve their business operations by leveraging its industry-wide experience, expertise in cutting-edge technology and an extensive portfolio of services.<a href=\"http://www.paladion.net\">Click</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"float:left; height:63px; margin-left:30px; margin-right:30px; width:384px\" /><strong>&nbsp;Procera Networks, Inc.</strong> the global intelligent policy enforcement company, that designs and sells Network Intelligence solutions based on deep packet inspection (DPI) technology.</p>\r\n\r\n<p>&nbsp;DRDL uses properties of applications for identification purposes, and this allows operators to manage subscriber traffic based on the application, similar to many DPI products. <strong>Procera</strong> offers over 100 use cases in Analytics, Traffic Management, Policy Enforcement, and Service Provider Compliance.<a href=\"http://www.sandvine.com\">Click</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"float:left; height:50px; margin-left:5px; margin-right:5px; width:160px\" />&nbsp; SAP Business One: SAP Business One is business management software (ERP) designed for small and medium-sized enterprises, sold by the German company SAP SE. As an ERP solution,it aims to automate key business functions in financials, operations, and human resources.<a href=\"http://www.sap.com\">Click</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"float:left; height:63px; margin-left:5px; margin-right:5px; width:160px\" />&nbsp;SOPHOS: Sophos Group plc is a security software and hardware company. Sophos develops products for communication endpoint, encryption, network security, email security,&nbsp; &nbsp;mobile&nbsp; security and unified threat management. Sophos is primarily focused on providing security software to the mid market and pragmatic enterprise from 100 to 5000 Seat&nbsp; &nbsp;organizations.&nbsp;<a href=\"https://www.sophos.com\" target=\"_blank\">Click</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"float:left; height:63px; margin-left:5px; margin-right:5px; width:160px\" />&nbsp;FORTINET: Fortinet is an American multinational corporation headquartered in Sunnyvale, California. It develops and markets cybersecurity software, appliances and services, such&nbsp; &nbsp;as&nbsp; firewalls, anti-virus, intrusion prevention and endpoint security, among others. It is the fourth-largest network security company by revenue.&nbsp;<a href=\"http://www.fortinet.com\" target=\"_blank\">Click</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"data:image/jpeg;base64,\" style=\"float:left; height:63px; margin-left:5px; margin-right:5px; width:160px\" />&nbsp;Axis Communications&nbsp; Axis is the market leader in network video. We invented the world&rsquo;s first network camera back in 1996 and we&rsquo;ve been innovators in video surveillance ever&nbsp; &nbsp; &nbsp;since,&nbsp; &nbsp;increasing the&nbsp;security of millions of people worldwide and helping to meet the growing need for a smarter, safer world.&nbsp;With the help of 90,000 partners, spanning 179&nbsp; &nbsp;countries,&nbsp; we&rsquo;ve&nbsp; &nbsp;delivered a series of groundbreaking products and many industry firsts. And, we look forward to pioneering many more.&nbsp;<a href=\"https://www.axis.com\" target=\"_blank\">Click</a>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2018-07-28 07:58:24', '2019-01-22 11:52:09');
INSERT INTO `pages` (`id`, `name`, `slug`, `s_description`, `priority`, `description`, `created_at`, `updated_at`) VALUES
(6, 'MISSION & VISION', 'mission-vision', 'We are dedicated to design, Install and support cost effective and high quality solutions in alliance with world class vendors.', 1, '<p>Target to be the most preferred to Bangladeshi clients, so as to maintain our reputation for credibility and integrity with our customer vendors and employees.&nbsp;In range of service dealing with success are sure result of commitment of delivery &amp; quality, this will bring our valued customers in trust circles. We will try to take us to a position where satisfied customer will be our team members and healthy business prevail for times to come.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>OUR MISSION</strong></h3>\r\n\r\n<p><img src=\"data:image/jpeg;base64,\" style=\"float:left; height:128px; width:384px\" /></p>\r\n\r\n<p>We are dedicated to design, Install and support cost effective and high quality solutions in alliance with world class vendors.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>OUR VISSION</strong></h3>\r\n\r\n<hr />\r\n<p><img src=\"data:image/png;base64,\" style=\"float:right; height:128px; width:381px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>To build an environment of trust and reliability in all activities we do.</p>', '2018-09-29 23:23:47', '2019-01-22 08:33:49');
INSERT INTO `pages` (`id`, `name`, `slug`, `s_description`, `priority`, `description`, `created_at`, `updated_at`) VALUES
(7, 'VALUES & BELIEVE', 'values-believe', 'Inspired by our vision, driven by our mission, and underpinned by our values, we will solve the most complex challenges and deliver a better service.', 3, '<p><strong>VALUES</strong></p>\r\n\r\n<hr />\r\n<p><img src=\"data:image/jpeg;base64,\" style=\"float:right; height:300px; width:323px\" />Inspired by <em>our</em> vision, driven by <em>our</em><em> </em>mission, and underpinned by <em>our values</em><em>,</em> we will solve the most complex challenges and deliver a better service. Delivering innovative infrastructure, designs, and security solutions to enable a sustainable, safer, smarter, and connected. Through the regular application of these six principles, we continue to provide values to our customers, and we consistently meet our goals.</p>\r\n\r\n<p><strong>ACCOUNTABILITY</strong> Team members are empowered to make right decision. We are fiscally responsible in our all dealings and accept responsibility for results</p>\r\n\r\n<p><strong>INNOVATION &amp; DIVERSITY </strong>We are committed to the continuous improvement of the programs, tools, and creative solutions for the benefit of the independent customer. We believe in meaningful productive change.</p>\r\n\r\n<p><strong>INTEGRITY</strong> We maintain professional ethics. Every interaction is executed with high level of honesty, respect and professionalism</p>\r\n\r\n<p><strong>CHALLENGES</strong> We challenge ourselves to be best, findings new ways to improve everything we do</p>\r\n\r\n<p><strong>QUALITY</strong> We plan, analyze and improve every process where necessary. We are confidence to ensure Quality of Service.</p>\r\n\r\n<p><strong>COLLABORATION </strong>Our success is dependent on that of our business partners. To achieve shared goals, we extend beyond our walls.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>BELIEVE</strong></p>\r\n\r\n<hr />\r\n<p>We believe, through the regular application of these five principles, we could achieve our success.</p>\r\n\r\n<p><img src=\"data:image/jpeg;base64,\" style=\"float:left; height:303px; width:300px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>DETERMINATION</strong> Excellence in everything we do</p>\r\n\r\n<p><strong>RESPONSIVENESS </strong>Bing creative and open&ndash;minded, pursuing growth and learning</p>\r\n\r\n<p><strong>TEAMWORK</strong> We act as a team, listening and involving others</p>\r\n\r\n<p><strong>HONESY</strong> Building lasting relationships with integrity</p>\r\n\r\n<p><strong>CUSTOMER SERVICE</strong> Being there for our clients, becoming our &lsquo;in-house&rsquo; translation team</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2018-09-29 23:25:03', '2019-01-22 08:36:16');
INSERT INTO `pages` (`id`, `name`, `slug`, `s_description`, `priority`, `description`, `created_at`, `updated_at`) VALUES
(8, 'OUR PRACTICE', 'our-practice', 'As business grows, there will need to change to adapt to new circumstances. Businessman can experiment with different', 2, '<p><strong>OUR PRACTICE</strong><img src=\"data:image/jpeg;base64,\" style=\"float:right; height:277px; margin-left:20px; margin-right:20px; width:478px\" /></p>\r\n\r\n<p>As business grows, there will need to change to adapt to new circumstances. Businessman can experiment with different ways of working to see which suits for his business best. But this approach is inefficient and may lead him to make inappropriate decisions.Evaluating how his operations compare with the most effective and profitable enterprises, and then using their most successful elements - the &quot;best practice&quot; in a businessman&rsquo;s own business, can make a big difference.&nbsp;</p>\r\n\r\n<p>We also practice some of as follows to increase our business growth-</p>\r\n\r\n<p><strong>Improve the Corporate Credibility</strong></p>\r\n\r\n<ul>\r\n	<li>Business operation ethics improvement</li>\r\n	<li>Work with honesty</li>\r\n	<li>Establish customer trust</li>\r\n	<li>Respond more quickly to innovations in your sector</li>\r\n	<li>Clear and careful strategic planning</li>\r\n</ul>\r\n\r\n<p><strong>Secure Technology</strong></p>\r\n\r\n<ul>\r\n	<li>Cause investigation before involvement</li>\r\n	<li>Improvement of accommodation</li>\r\n	<li>Reviewing appropriate national and international standards</li>\r\n	<li>Technology revivification and check back</li>\r\n	<li>Prevent recurrence</li>\r\n</ul>\r\n\r\n<p><strong>Strength Competition</strong></p>\r\n\r\n<ul>\r\n	<li>Avoid unhealthy business</li>\r\n	<li>Become more competitive</li>\r\n	<li>Use technology more effectively</li>\r\n	<li>Improve the skills of your workforce</li>\r\n	<li>Reduce waste and improve quality</li>\r\n	<li>Reduce costs and become more efficient</li>\r\n</ul>\r\n\r\n<p><strong>Strategic Management</strong></p>\r\n\r\n<ul>\r\n	<li>Involving employees in the development of the business</li>\r\n	<li>Adopting flexible working and policies that encourage equality and diversity</li>\r\n	<li>Establish system of risk recovery</li>\r\n	<li>First safety, Accident ZERO</li>\r\n	<li>Standard Compliance</li>\r\n</ul>', '2018-09-29 23:25:43', '2019-01-22 08:42:18'),
(9, 'Training', 'training', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry.', NULL, '<p>Education is any kind of knowledge transitioned into learning.</p>\r\n\r\n<p>LIVEWIRE promote niche training in IT, Electronics &amp; Electricals creating experts for emerging technology industries and specialist technology jobs. A part of CADD Centre, which is Asia&#39;s largest CAD/CAM/CAE training institute. LIVEWIRE is present in 100 locations across India and 6 Countries.</p>', '2018-12-08 01:18:26', '2018-12-10 00:52:53'),
(10, 'What We Do', 'what-we-do', 'ECL has confidence in delivering a customized solution with the highest quality of service in all aspects of its business operations.', 4, '<p>We at ECL, create positive solutions, integrating hi-tech security solutions in the hands of skilled and trained professionals to produce a service above and beyond its opponents. ECL has confidence in delivering a customized solution with the highest quality of service in all aspects of its business operations.</p>\r\n\r\n<p>ECL has three Divisions of operations:</p>\r\n\r\n<ul>\r\n	<li>Business and Security Solutions</li>\r\n	<li>Data Center design, implementation &amp; commission</li>\r\n	<li>Networking &amp; Training</li>\r\n</ul>\r\n\r\n<p>We pride ourselves in being the best at what we do, the services we provide, the products we use, the clients we serve and the employees we hire.</p>', '2019-01-24 06:21:28', '2019-01-24 06:21:28');
INSERT INTO `products` (`id`, `name`, `brand_id`, `model_no`, `slug`, `document`, `price`, `description`, `technical_features`, `general_features`, `safety_and_veri`, `image`, `image2`, `image3`, `image4`, `status`, `order`, `created_at`, `updated_at`) VALUES
(1, 'Rodent System', 3, 'VHFO V2', 'vhfo-v2', NULL, NULL, '<p>This is a Controller.</p>', '<ol>\r\n	<li>Area Coverage-Room Void</li>\r\n	<li>&nbsp; &nbsp;a. 3.600 Sq.Ft.- Dedicated Connection</li>\r\n	<li>&nbsp; &nbsp; b. 7,200 Sq.Ft.- Looped Connection</li>\r\n	<li>Can support upto 12 transducers in a Dedicated Connection &amp; 24 in a Looped Connection.</li>\r\n	<li>Auto and Manual Modes of Operation.</li>\r\n	<li>Single Driver for all transducers.</li>\r\n	<li>5 Wave Speeds, 4 Wave Densities and 4 Frequency Bands of Operation</li>\r\n	<li>Transducer Sound Output Verification and Analysis</li>\r\n</ol>', '<ol>\r\n	<li><strong>Transformer Rating&nbsp;:&nbsp;</strong> 25 V.A. UL &amp; CE Approved</li>\r\n	<li><strong>Power Supply &nbsp;:&nbsp;</strong>230 V AC/50 HZ or 14 Volts AC</li>\r\n	<li><strong>Dimensions (WidthXDepthXHeight) &nbsp;:&nbsp;</strong>200 mm x 300 mm x 85 mm</li>\r\n	<li><strong>Weight&nbsp;:&nbsp;</strong> 3.5 Kgs Approximately</li>\r\n	<li><strong>Mounting &nbsp;:&nbsp;</strong>Wall/ Table Mounting</li>\r\n	<li><strong>Power Consumption &nbsp;:&nbsp;</strong>15 Watts Approximately</li>\r\n</ol>', '<ol>\r\n	<li>100% Output Verification with the help of Maser Wave Analyzer Hardware and Software</li>\r\n	<li>Safety Compliance as per IRPA (International Radiation Protection Association) Geneva.</li>\r\n	<li>Record and Report 1/3 rd Octave Band Frequencies thereby ensuring human safety as per IRPA Guidelines</li>\r\n	<li>Record and Report Individual Frequencies alongwith corresponding sound pressure levels.</li>\r\n</ol>', 'images/Products/1538543153.jpg', 'images/Products/15388214942.jpg', NULL, NULL, 1, 6, '2018-10-02 23:05:53', '2018-12-06 03:43:43'),
(3, 'ENVIROMUX Liquid Detection Sensor', 4, 'E-LDS10', 'enviromux-liquid-detection-sensor', NULL, NULL, '<p><strong>ENVIROMUX Server Environment Monitoring System Liquid Detection Sensor.</strong></p>\r\n\r\n<p>For warning of flooding.<br />\r\n<br />\r\n&bull; Includes a 10 feet long Water Sensor Cable.<br />\r\n&bull; Select the desired length of a 2-Wire Cable (used to connect the sensor to ENVIROMUX-SEMS-16 or SERIMUX-S-x) to order from the list below (5 to 100 feet) at&nbsp;no additional cost.</p>', NULL, '<ol>\r\n	<li>Detects liquid depth &gt;0.1&quot;.</li>\r\n	<li>&bull; Minimum puddle: 0.6&quot; diameter.</li>\r\n	<li>&bull; 100% waterproof electronics.</li>\r\n	<li>&bull; Detects any liquid or moisture, except deionized water.</li>\r\n	<li>&bull; RJ45 connector.</li>\r\n	<li>&bull; Supports CAT-5/5e/6 cable up to 1,000 ft. (not included)</li>\r\n	<li>&bull; Available 2-wire cable (y) lengths: 5/10/20/50/100 feet.</li>\r\n</ol>', NULL, 'images/Products/1544082814.jpg', NULL, NULL, NULL, 1, 10, '2018-10-05 22:47:51', '2018-12-06 03:28:01'),
(4, 'ENVIROMUX Temperature/Wide Range Humidity/Dew Point Sensor', 4, 'E-STHS-99', 'enviromux-temperature-wide-range-humidity-dew-point-sensor', NULL, NULL, '<p><strong><em>E-STHS-99: Temperature, wide-range humidity (up to 99% RH) and dew-point combination sensor&nbsp;</em></strong></p>\r\n\r\n<p>for&nbsp;ENVIROMUX server environment monitoring system&nbsp;</p>', NULL, '<ol>\r\n	<li>&bull; Applications from 32&deg;F to 122&deg;F</li>\r\n	<li>&bull; Accurate to within &plusmn;2&deg;F (0&deg;C to 50&deg;C, &plusmn;1&deg;C)</li>\r\n	<li>&bull; 20% to 80% relative humidity, &plusmn;3%</li>\r\n	<li>&bull; 10% to 90% relative humidity, &plusmn;4%</li>\r\n	<li>&bull; 0% to 99% relative humidity, &plusmn;5%</li>\r\n	<li>&bull;&nbsp;Supports dew point measurement.</li>\r\n	<li>&bull; High resistance to external influences on the cable due to digital output signal.</li>\r\n	<li>&bull; Re-calibration is not necessary after initial set-up.</li>\r\n	<li>&bull; RJ45 connector.</li>\r\n	<li>&bull; Supports CAT-5/5e/6 cable up to 1,000 ft.(not included)</li>\r\n	<li>&bull;&nbsp;Current consumption: 10mA @ 5VDC.</li>\r\n	<li>&bull; Powered by ENVIROMUX-2D/5D/16D.</li>\r\n	<li>&bull;&nbsp;Regulatory approvals: CE, RoHS</li>\r\n	<li>&bull; Compatible with ENVIROMUX-FSC Fiber Converter/Extender (Use to extend sensor up to 1.2 miles (2 km) from the ENVIROMUX unit</li>\r\n</ol>', NULL, 'images/Products/1538823933.jpg', 'images/Products/15388239332.jpg', NULL, NULL, 1, 9, '2018-10-05 22:58:44', '2018-12-06 03:27:46'),
(5, 'Vibration Sensor - Registers Movement & Shocks', 4, 'E-VSSB', 'vibration-sensor---registers-movement-&-shocks', NULL, NULL, '<p><strong>Environment Monitoring System Vibration &amp; Glass Break Sensors</strong></p>\r\n\r\n<p><strong>Motion / Intrusion / Vibration Sensors compatible with ENVIROMUX&reg;&nbsp;</strong><a href=\"http://www.networktechinc.com/environment-monitor-2d.html\">E-2D</a>,&nbsp;<a href=\"http://www.networktechinc.com/environment-monitor-5d.html\">E-5D</a>&nbsp;and&nbsp;<a href=\"http://www.networktechinc.com/environment-monitor-16d.html\">E-16D</a></p>', NULL, '<ol>\r\n	<li>E-VSSB</li>\r\n	<li>For registering movement and shocks - sensed through surface to which it is mounted.</li>\r\n	<li>Trigger duration: 3.1 to 4.1 seconds</li>\r\n	<li>RJ45 connector for connecting to an E-2D/5D/16D.\r\n	<ol>\r\n		<li>Maximum cable length: 1,000 ft (305 m)</li>\r\n	</ol>\r\n	</li>\r\n	<li>Voltage Supply: 5VDC</li>\r\n	<li>Current Consumption: 15mA</li>\r\n	<li>Operating temperature: 32 to 104&deg;F (0 to 60&deg;C)</li>\r\n	<li>Storage temperature: -22 to 140&deg;F (-30 to 60&deg;C)</li>\r\n	<li>Relative Humidity: 17 to 90% non-condensing RH.</li>\r\n	<li>Powered by E-2D/5D/16D.</li>\r\n	<li>Compatible with E-2D/5D/16D.</li>\r\n	<li>Mounting bracket included.</li>\r\n	<li>Dimensions without bracket WxDxH: 2x2.5x1.28 in (51x64x33 mm)</li>\r\n	<li>Dimensions without bracket WxDxH: 3.75x2.5x1.34 in (95x64x34 mm)</li>\r\n	<li>Regulatory approvals: CE, RoHS</li>\r\n</ol>', NULL, 'images/Products/1538824712.jpg', NULL, NULL, NULL, 1, 11, '2018-10-05 23:18:32', '2018-12-06 03:28:21'),
(6, 'Low-Cost Infrared Motion Sensor – CE Compliant', 4, 'E-IMD-LC', 'low-cost-infrared-motion-sensor-–-ce-compliant', NULL, NULL, '<p><strong>Environment Monitoring System Motion Detection Sensors</strong></p>\r\n\r\n<p><strong>Motion/Intrusion Sensors compatible with ENVIROMUX&reg;&nbsp;<a href=\"http://www.networktechinc.com/environment-monitor-2d.html\">E-2D</a>,&nbsp;<a href=\"http://www.networktechinc.com/environment-monitor-5d.html\">-5D</a>&nbsp;and&nbsp;<a href=\"http://www.networktechinc.com/environment-monitor-16d.html\">E-16D</a></strong></p>', NULL, '<ol>\r\n	<li>Registers movement in area covered: 39x39 ft (12x12 m), 110&deg; wide.</li>\r\n	<li>Condition display via LED.</li>\r\n	<li>Adjustable sensitivity.</li>\r\n	<li>Intelligent logic control prevents false alarms.</li>\r\n	<li>Wall mount or hang in a corner.</li>\r\n	<li>Pulse count adjustment.</li>\r\n	<li>Good RFI protection.</li>\r\n	<li>Screw terminal.\r\n	<ol>\r\n		<li>Connect to digital input or RJ45 sensor ports on an ENVIROMUX system.\r\n		<ol>\r\n			<li>To connect to the digital inputs, use a 22 AWG 2-wire cable. Connect the other end to the sensor screw terminal.</li>\r\n			<li>To connect to the RJ45 inputs, use CAT5/5e/6 cable terminated at one end with RJ45 connector. Connect the un-terminated end to the sensor screw terminal.</li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>Current consumption: 18mA @ 12VDC.</li>\r\n	<li>Powered by the E-2D/5D/16D.</li>\r\n	<li>Includes mounting bracket for installing the sensor to a ceiling or wall.</li>\r\n	<li>Regulatory approvals: CE, RoHS.</li>\r\n</ol>', NULL, 'images/Products/1544081798.jpg', NULL, NULL, NULL, 1, 12, '2018-10-05 23:21:49', '2018-12-06 03:28:44'),
(7, 'Fingerprint Access Control System', 4, 'E-FACS', 'fingerprint-access-control-system', NULL, NULL, '<p>Environment Monitoring System Access Control<br />\r\nAccess Control Systems &amp; Accessories compatible with E-2D, E-5D and E-16D</p>', NULL, '<ul>\r\n	<li>Biometric fingerprint reader with durable and highly accurate optical sensor.</li>\r\n	<li>Quick single touch, one second user recognition.</li>\r\n	<li>Alarm, door, and egress button contacts.</li>\r\n	<li>Selectable 26-bit or 34-bit Wiegand data input and output.</li>\r\n	<li>Audio-visual indicators for acceptance and rejection of valid/invalid fingerprints.</li>\r\n	<li>Stores up to 600 fingerprint templates and 15,000 transactions.</li>\r\n	<li>Built-in serial, USB, and Ethernet ports for RS232/RS485, USB Host, and TCP/IP communication.</li>\r\n	<li>Includes the following management software:\r\n	<ul>\r\n		<li>Access Control Software\r\n		<ul>\r\n			<li>Import and export all user data, and set up sensor settings and delay.</li>\r\n			<li>Keeps logs of all user entries.</li>\r\n		</ul>\r\n		</li>\r\n		<li>Attendance Management Software\r\n		<ul>\r\n			<li>Configure employee schedules and monitor and download access logs.</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>Tamper-proof.</li>\r\n	<li>IP65 rated.</li>\r\n	<li>Compatible EM cards (E-RFID-CRD10) and keyfobs (E-RFID-KYFB10) are available in packs of ten.</li>\r\n	<li>Current consumption: 200mA @ 12VDC.</li>\r\n	<li>Powered by E-2D/5D/16D.</li>\r\n	<li>Operating temperature: 14 to 140&deg;F (-10 to 60&deg;C).</li>\r\n	<li>Operating humidity: 10 to 90% non-condensing RH.</li>\r\n	<li>Dimensions (WxDxH): 2.87x1.38x5.83 in (73x35x148 mm).</li>\r\n	<li>Regulatory approvals: CE, FCC, RoHS.</li>\r\n</ul>', NULL, 'images/Products/1544084826.jpg', NULL, NULL, NULL, 1, 14, '2018-10-05 23:26:28', '2018-12-06 03:29:15'),
(8, 'USB 3G Modem', 4, 'E-3GU-4', 'usb-3g-modem', NULL, NULL, '<ul>\r\n	<li>Sends SMS text messages to a pager or cell phone when a sensor goes out of range of a configurable threshold.</li>\r\n	<li>Use to access the ENVIROMUX web interface.\r\n	<ul>\r\n		<li>The SIM card must have a &quot;public&quot; IP address for full control of the<br />\r\n		E-2D/5D/16 through the modem.</li>\r\n	</ul>\r\n	</li>\r\n	<li>SIM card supporting SMS messaging required (not included).</li>\r\n	<li>Supports third generation (3G) digital cellular standards.</li>\r\n	<li>USB 2.0 stick with Male USB Type A connector</li>\r\n	<li>3G network band: HSPA+/HSUPA/HSDPA/HSPA/UMTS(WCDMA)-2100 MHz.</li>\r\n	<li>2G network band: GSM/GPRS/EDGE-850/900/1800/1900 MHz</li>\r\n	<li>When connected to the ENVIROMUX system, protrudes 2.68&quot; from the edge of the case.</li>\r\n	<li>Compatible with E-2D/5D/16D.\r\n	<ul>\r\n		<li>Not compatible with E-SEMS-16U.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Will ship with either a white or black case.</li>\r\n	<li>Regulatory approvals: CE, RoHS</li>\r\n</ul>', NULL, '<ul>\r\n	<li>Sends SMS text messages to a pager or cell phone when a sensor goes out of range of a configurable threshold.</li>\r\n	<li>Use to access the ENVIROMUX web interface.\r\n	<ul>\r\n		<li>The SIM card must have a &quot;public&quot; IP address for full control of the<br />\r\n		E-2D/5D/16 through the modem.</li>\r\n	</ul>\r\n	</li>\r\n	<li>SIM card supporting SMS messaging required (not included).</li>\r\n	<li>Supports third generation (3G) digital cellular standards.</li>\r\n	<li>USB 2.0 stick with Male USB Type A connector</li>\r\n</ul>', NULL, 'images/Products/1538826061.jpg', NULL, NULL, NULL, 1, 13, '2018-10-05 23:41:01', '2018-12-06 03:29:00'),
(13, 'Tripod Turnstile', 2, 'SST1020A', 'turnstile-C8J', NULL, NULL, '<p><strong>Stainless Steel Half Height Turnstile </strong></p>\r\n\r\n<p>Auto tripod turnstile adopts the stepping motor to drive the equipment. It is used in the entrance of factories and communities. Maxview brings in advanced and experience to improve. And it can prevent passing multiple people for one card reading and manual force to the arm. According to the specific requirement, it can work with door access control and time attendance system.</p>', NULL, '<ul>\r\n	<li>Beautiful design, antirust and durable.</li>\r\n	<li>Standard Interface, support external card / fingerprint readers</li>\r\n	<li>Designed with stainless steel and water proof</li>\r\n	<li>Self-check function</li>\r\n	<li>Auto recovery</li>\r\n</ul>', NULL, 'images/Products/1542539683.jpg', NULL, NULL, NULL, 1, 18, '2018-11-18 05:14:43', '2018-12-06 03:30:16'),
(14, 'Flap Barrier Turnstile', 2, 'SSF2010', 'flap-barrier-turnstile-9hy', NULL, NULL, '<p><strong>Stainless Steel Half Height </strong></p>\r\n\r\n<p>Flap Barrier Flap Barrier turnstile adopts the stepping motor to drive the equipment. It is used in the entrance of factories and communities. Maxview brings in advanced and experience to improve. And it can prevent passing multiple people for one card reading and manual force to the arm. According to the specific requirement, it can work with door access control and time attendance system.</p>', NULL, '<ul>\r\n	<li>Beautiful design</li>\r\n	<li>antirust and durable</li>\r\n	<li>Standard Interface, support external card / fingerprint readers</li>\r\n	<li>Designed with stainless steel and water proof</li>\r\n	<li>Self-check function &bull; Auto recovery</li>\r\n</ul>', NULL, 'images/Products/1542542313.jpg', NULL, NULL, NULL, 1, 15, '2018-11-18 05:58:33', '2018-12-06 03:29:34'),
(15, 'Half Height Turnstile', 2, 'SSF2050', 'half-height-turnstile-tp8', NULL, NULL, '<p><strong>Stainless Steel Half Height Turnstile </strong></p>\r\n\r\n<p>SSF2050 is designed to provide unsupervised access control for office or buildings. The impenetrable construction eliminates any unauthorized access to restricted area. To gain authorized passage through SSF2050, the user must present a valid card / fingerprint for the access control system. Upon presentation of the valid card / fingerprint, SSF2050 will unlock and allow the user to pass through the direction requested. The turnstile can also work with push button and face recognition access control systems.</p>', NULL, '<ul>\r\n	<li>Stainless steel machine case</li>\r\n	<li>Standard Interface, support external card / fingerprint readers</li>\r\n	<li>Infrared light detecting, Alarming when illegal infiltration or tailing</li>\r\n	<li>Clamping avoid</li>\r\n</ul>', NULL, 'images/Products/1542543359.jpg', NULL, NULL, NULL, 1, 16, '2018-11-18 06:15:59', '2018-12-06 03:29:44'),
(16, 'Full Height Turnstile Gate', 2, 'SSH6030', 'full-height-turnstile-gate-KmW', NULL, NULL, '<p><strong>Stainless Steel Full Height Turnstile </strong></p>\r\n\r\n<p>SSH6030 is designed to provide unsupervised access control for office or buildings. The impenetrable construction eliminates any unauthorized access to restricted area. To gain authorized passage through SSH6030, the user must present a valid card / fingerprint for the access control system. Upon presentation of the valid card / fingerprint, SSH6030 will unlock and allow the user to pass through the direction requested. The turnstile can also work with push button and face recognition access control systems.</p>', NULL, '<ul>\r\n	<li>Stainless steel machine case</li>\r\n	<li>Standard Interface, support external card / fingerprint readers</li>\r\n	<li>Adjustable access way</li>\r\n</ul>', NULL, 'images/Products/1542543851.jpg', NULL, NULL, NULL, 1, 17, '2018-11-18 06:24:11', '2018-12-06 03:29:56'),
(17, 'Car Park Barrier Systems', 2, 'D107', 'car-park-barrier-systems-hwy', NULL, NULL, '<p>Make the right choice for your property. Huntaway Security are leading suppliers of car park barriers, helping you better control access to your property. Designed for durability and reliability, they&rsquo;re a smart investment for any public or private carpark.</p>\r\n\r\n<p>Huntaway Security recognises the importance of high-quality access control systems to every property. We provide a comprehensive range of products at some of the most competitive prices in Singapore, making it simpler for site managers and building owners to manager entry to their car parks. When you&rsquo;re looking for a high-quality security solution for your property at an affordable price, look no further than our catalogue.</p>', '<ul>\r\n	<li>Drive Steady</li>\r\n	<li>Lower Noise</li>\r\n	<li>Structures Compact</li>\r\n	<li>Self-Locking</li>\r\n</ul>', '<h2>Providing the feature you need</h2>\r\n\r\n<p>Our automatic vehicle barriers are able to be monitored and controlled remotely from the security guardhouse, ensuring faster and more convenient access to the property for authorised personnel. An effective access control solution for vehicle movements to and from the carpark, the Huntaway range is equipped with powerful 60 and 70W motors and reliable mechanisms, delivering the quality and speed of operation you&rsquo;ve been looking for. Ideal for high traffic areas and industrial lots, their durable construction keeps maintenance to a minimum, providing a comprehensive and no-fuss access solution.</p>', NULL, 'images/Products/1542545539.jpg', 'images/Products/15425445092.jpg', 'images/Products/15425455393.jpg', NULL, 1, 19, '2018-11-18 06:35:10', '2018-12-06 03:30:28'),
(18, 'Aspirating Smoke Detection System(VESDA)', 1, 'VLF-250', 'aspirating-smoke-detection-system(vesda)-4au', NULL, NULL, '<p>The VESDA VLF-250 detector is a very early warning smoke detector<br />\r\ndesigned to protect small, business-critical environments of less than 250 m2<br />\r\n(2,690 sq. ft.).<br />\r\nThe detector works by continually drawing air into sampling holes in a pipe<br />\r\nnetwork. The air is filtered and passed into a detection chamber where light<br />\r\nscattering technology detects the presence of very small amounts of smoke.<br />\r\nDetector status information is communicated on the detector display and via<br />\r\nrelays or optional interface cards.</p>', NULL, '<p><strong>Features</strong><br />\r\n&bull; Out-of-the-Box Installation and<br />\r\nCommissioning<br />\r\n&bull; Ultrasonic Airflow Sensing<br />\r\n&bull; Laser-Based Absolute Smoke Detection<br />\r\n&bull; Pre-engineered pipe network designs<br />\r\n&bull; Programmable Alarm Thresholds<br />\r\n&bull; Clean air barrier optics protection<br />\r\n&bull; Instant Recognition Display<br />\r\n&bull; Instant Fault Finder&trade;<br />\r\n&bull; AutoLearn&trade; Smoke<br />\r\n&bull; AutoLearn&trade; Flow<br />\r\n&bull; Field Service Access Door<br />\r\n&bull; Multiple Event Logging in separate logs<br />\r\n&bull; Event log &ndash; up to 18000 events<br />\r\n&bull; Offline/online configuration capability<br />\r\n&bull; Up to 250 m2 (2,690 sq. ft.) coverage*</p>', NULL, 'images/Products/1542544841.png', NULL, NULL, NULL, 1, 2, '2018-11-18 06:40:41', '2018-12-06 03:24:47'),
(19, 'VESDA', 1, 'VLP', 'vesda-2Hq', NULL, NULL, '<p>The VESDA VLP detector is the central element of the VESDA ASD product range.<br />\r\nUsing unique detection principles, the VLP has an alarm sensitivity range of 0.005%&ndash;<br />\r\n20% obscuration/m (0.0015%&ndash;6.25% obscuration/ft). The VLP is classed as a &ldquo;Very<br />\r\nEarly Warning Smoke Detector&rdquo;, which means that it detects fire at the earliest possible<br />\r\nstage and reliably measures very low to extremely high concentrations of smoke.<br />\r\n<strong>How It Works</strong><br />\r\nAir is drawn into the VLP through a network of air sampling pipes by a high efficiency<br />\r\naspirator. Each inlet pipe has an airflow sensor that monitors airflow changes in the<br />\r\npipes. Air is exhausted from the VLP and may be vented back into the protected zone.<br />\r\nInside the VLP, a sample of air is passed into the laser detection chamber. Ultra-fine air<br />\r\nfiltration provides very clean air to protect the optical surfaces inside the detector from<br />\r\ncontamination.<br />\r\nThe detection chamber uses a stable Class 1 laser light source and carefully positioned<br />\r\nsensors to achieve the optimum response to a vast range of smoke types.<br />\r\nThe status of the detector, and all alarm, service and fault events, are transmitted to<br />\r\ndisplays and external systems via VESDAnet.</p>', NULL, '<p><strong>Features</strong><br />\r\n&bull; Wide sensitivity range<br />\r\n&bull; Laser based smoke detection<br />\r\n&bull; 4 configurable alarm levels<br />\r\n&bull; High efficiency aspirator<br />\r\n&bull; Four inlet pipes<br />\r\n&bull; Airflow supervisor per sampling pipe<br />\r\n&bull; Clean air barrier optics protection<br />\r\n&bull; Easy to replace air filter<br />\r\n&bull; 7 programmable relays<br />\r\n&bull; VESDAnet&trade;<br />\r\n&bull; AutoLearn&trade;<br />\r\n&bull; Referencing<br />\r\n&bull; Event log<br />\r\n&bull; Modular design<br />\r\n&bull; Recessed mounting option</p>', NULL, 'images/Products/1543665782.jpg', NULL, NULL, NULL, 1, 1, '2018-11-18 06:43:23', '2018-12-06 03:24:33'),
(21, 'Motion Detection Systems', 5, 'ADPRO Perimeter', 'motion-detection-systems-hh1', NULL, NULL, '<p><strong>ADPRO Perimeter, Multi-site, and Enterprise Security Solutions</strong></p>\r\n\r\n<p>Xtralis invented the industry&rsquo;s first motion detection systems and has been at the heart of multi-site, remotely monitored security for more than 30 years. From our perimeter security solutions to our award-winning transmission and video management systems, ADPRO&nbsp;helps you see the bigger picture to transform your approach to security from reactive to proactive threat detection. And we continue to innovate with our latest generation technologies so you can protect your facility from its edge to its core.</p>\r\n\r\n<p><strong>ADPRO Perimeter Security&nbsp;</strong><br />\r\nFacility protection starts at the perimeter, detecting intruders before any potential problems occur. Our perimeter security&nbsp;solutions use a combination of technologies to maximize detection performance and minimize false alarms.&nbsp;&nbsp;</p>', NULL, '<p><strong>Industries and Applications&nbsp;</strong><br />\r\nADPRO&nbsp;perimeter, multi-site and enterprise security solutions are suitable for a wide range of industries and applications.</p>\r\n\r\n<ul>\r\n	<li>Airports</li>\r\n	<li>Banks/Financial Institutions</li>\r\n	<li>Corporate Office/Commercial Facilities</li>\r\n	<li>Critical Infrastructure &nbsp;</li>\r\n	<li>Government Facilities</li>\r\n	<li>Healthcare Facilities</li>\r\n	<li>Industrial Facilities</li>\r\n	<li>Prisons</li>\r\n	<li>Remote Monitoring Centers</li>\r\n	<li><a href=\"https://xtralis.com/file.cfm?id=456\">Retail/Commercial</a></li>\r\n	<li>Telecommunications</li>\r\n	<li><a href=\"https://xtralis.com/file.cfm?id=459\">Transportation</a></li>\r\n	<li>Universities</li>\r\n	<li>Warehousing/Logistics</li>\r\n</ul>', NULL, 'images/Products/1542545478.jpg', 'images/Products/15425454312.png', 'images/Products/15425454333.jpg', 'images/Products/15425454784.jpg', 1, 5, '2018-11-18 06:50:33', '2018-12-06 03:25:23'),
(22, 'Environment Monitoring System(EMS)', 4, 'ENVIROMUX 16D', 'environment-monitoring-system(ems)-fqT', NULL, NULL, '<p>The ENVIROMUX&reg; Enterprise Environment Monitoring System (EMS) monitors critical environmental conditions, such as temperature, humidity, liquid water presence, power, intrusion, and smoke. When a sensor goes out of range of a configurable threshold, the system will notify you via email, LEDs, alarm beacon, siren, web page, network management (SNMP), voice phone calls (via Automatic Voice Dialer System), and SMS messages (via external USB 3G modem).</p>\r\n\r\n<p>The system includes three internal sensors: temperature, humidity and power. It also supports 16 external configurable sensors, eight digital input sensors, and four output relays for control of external devices.</p>', NULL, '<p>The system includes three internal sensors: temperature, humidity and power. It also supports 16 external configurable sensors, eight digital input sensors, and four output relays for control of external devices.</p>\r\n\r\n<ul>\r\n	<li>Monitor and manage server room environmental and security conditions over IP.</li>\r\n	<li>Sensors supported:\r\n	<ul>\r\n		<li>16 external configurable sensors</li>\r\n		<li>8 digital inputs sensitive to contact closure</li>\r\n		<li>3 internal sensors &ndash; temperature, humidity, power</li>\r\n		<li>8&nbsp;<a href=\"http://www.networktechinc.com/environment-monitor-micro.html\">Remote Temperature/Humidity Sensors over IP</a>\r\n		<ul>\r\n			<li>E-MICRO-T: 1 integrated temperature sensor, 2 RJ45 ports for external temperature/humidity sensors, 2 digital inputs sensitive to contact closure, dual DC power (dual redundancy).</li>\r\n			<li>E-MICRO-TRHP: 1 integrated temperature/humidity combination sensor, 2 RJ45 ports for external temperature/humidity sensors, 2 digital inputs sensitive to contact closure, built-in Power over Ethernet (POE), dual DC power (triple redundancy).</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>Four output relays for control of external devices.\r\n	<ul>\r\n		<li>Relay activates upon alarm or via the user interface.</li>\r\n		<li>Control output relays via SNMP SET commands to power on/off external devices.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Supports IP network video cameras for live view of any facility.\r\n	<ul>\r\n		<li>One integrated view &ndash; see different Web cameras side-by-side with physical and environmental parameters.</li>\r\n		<li>Any programmed event can trigger a snapshot from an IP camera.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Monitor (ping) up to 64 IP network devices.\r\n	<ul>\r\n		<li>Alerts are sent if devices are not responding</li>\r\n	</ul>\r\n	</li>\r\n	<li>Linux inside.</li>\r\n	<li>Create multiple alerts for any installed sensor.</li>\r\n	<li>Sensor conditions (events) can be configured to trigger alerts by themselves, and/or be used in combination with other events to trigger Smart Alerts.\r\n	<ul>\r\n		<li>Configure up to 50 events.\r\n		<ul>\r\n			<li>Setup SSH commands to be sent when events are triggered to soft shutdown or reboot machines.</li>\r\n		</ul>\r\n		</li>\r\n		<li>Up to 20 Smart Alerts can be configured to use different event combinations to send alert messages.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Alerts are posted in message log, which is accessible through Web user interface.</li>\r\n</ul>', NULL, 'images/Products/1542545976.jpg', NULL, NULL, NULL, 1, 8, '2018-11-18 06:59:36', '2018-12-06 03:27:20'),
(23, 'TVSS', 6, 'ASCO 400 SERIES', 'tvss-5Zk', NULL, NULL, '<p>Features:</p>\r\n\r\n<ul>\r\n	<li>UL 1449 Fourth Edition Listed &bull; 50kA 8 x 20&micro;s</li>\r\n	<li>&nbsp;All UL required OCP &amp; Safety Coordination included inside &ndash;</li>\r\n	<li>Type 1 SPDs intended for Line or Load Side of Main Disconnect &ndash; Type 2 SPDs intended for Load Side of Main Disconnect &bull; 200kA SCCR (most models)</li>\r\n	<li>Meets UL 96A Lightning Protection Master Label</li>\r\n	<li>All UL-required OCP &amp; Safety Coordination Included Inside</li>\r\n	<li>Voltage Specific Design: Performs better than &lsquo;one-size fits all&rsquo;</li>\r\n	<li>Tri-Mount Installation for more mounting flexibility: &ndash; Same unit mounts on Pipe Nipple, Bracket or DIN-Rail</li>\r\n	<li>Visual Diagnostics: Easy to See; Easy to Understand &bull; 10 year warranty (longer optional)</li>\r\n</ul>', NULL, '<p><strong>Performance Specifications </strong></p>\r\n\r\n<p>50kA 8 x 20&micro;s Per Mode UL 1449 tested Inominal</p>\r\n\r\n<p>20kA (highest available) UL 1449 tested SCCR</p>\r\n\r\n<p>200kA (most models) Large-Block, 34mm square, 50kA MOVs Individually Fused &amp; Thermally Protected MOVs UL 1449 Voltage Protection Ratings (VPRs): &nbsp;</p>\r\n\r\n<p>600V for 120V, 120/240, 208Y/120</p>\r\n\r\n<p>1000V for 277V, 480Y/277V</p>\r\n\r\n<p>Repetitive Impulse: 5000 - 3kA - 8 x 20&micro;s; 1000 - 10kA - 8 x 20&micro;s</p>', NULL, 'images/Products/1542546489.png', NULL, NULL, NULL, 1, 7, '2018-11-18 07:08:09', '2018-12-06 03:27:09'),
(25, 'Flame Detector', 7, '40/40I Triple IR (IR3)', 'flame-detector-P7f', NULL, NULL, '<p><strong>Product Overview</strong></p>\r\n\r\n<p>The new 40/40I, a multi spectrum based on three IR bands (IR3), detects fuel and gas fires at long distances with the highest immunity to false alarms. The 40/40I IR3 can detect a 1 ft2 (0.1m2) gasoline pan fire at 215 ft (65m) in less than 5 seconds. The 40/40I is the most durable and weather resistant flame detector currently on the market. Its new features include a heated window, to eliminate condensation and icing; HART capabilities for digital communications; lower power requirements; and a compact, lighter design. Ideal for:</p>\r\n\r\n<ul>\r\n	<li>Power Generation facilities&nbsp;</li>\r\n	<li>Pharmaceutical Industry</li>\r\n	<li>Printing Industry</li>\r\n	<li>Warehouses</li>\r\n</ul>', '<ul>\r\n	<li>Multi spectrum design - for long distance detection and high false alarm immunity</li>\r\n	<li>Sensitivity selection - to ensure no zone crossover detection</li>\r\n	<li>Automatic and Manual Built-In-Test (BIT) - to assure continued reliable operation</li>\r\n</ul>', '<ul>\r\n	<li>Heated window - for operation in harsh weather conditions (snow, ice, condensation)</li>\r\n	<li>Multiple output options for maximum flexibility and compatibility</li>\r\n	<li>5-Year Warranty</li>\r\n</ul>', NULL, 'images/Products/1544087518.jpg', 'images/Products/15440875182.jpg', NULL, NULL, 1, 4, '2018-12-06 03:11:58', '2018-12-06 03:25:11'),
(26, 'Open-Area Smoke Detection', 8, 'OSID', 'open-area-smoke-detection-kG7', NULL, NULL, '<h1>OSID by Xtralis Sets New Standards in Open-Area Smoke Detection</h1>\r\n\r\n<h2>The company that revolutionized very early warning smoke detection with VESDA has reinvented smoke detection for open spaces with Open-area Smoke Imaging Detection (OSID). OSID by Xtralis provides reliable, cost-effective smoke detection for open spaces where fire detection presents unique challenges and where very early warning is not always the priority.</h2>\r\n\r\n<p>In its simplest configuration, OSID by Xtralis uses one imager, a camera-like device with a wide field of view, and a wired or battery-powered emitter roughly aligned on the opposite wall within the protected area. The emitter sends both infrared and ultraviolet coded light signals to the imager. If the light reception is altered due to the presence of genuine smoke particles, the imager will go into alarm. The novel use of dual light frequencies in an open-path device enables OSID to discriminate between real smoke and other objects, including insects, steam, condensation and dust, thus drastically reducing false alarms.</p>\r\n\r\n<p><strong>Industries and Applications</strong></p>\r\n\r\n<p>OSID is ideal for use in a wide range of industries and applications. These include atriums, domes and large rooms in:</p>\r\n\r\n<ul>\r\n	<li>Airports</li>\r\n	<li>Train stations</li>\r\n	<li>Shopping centers</li>\r\n	<li>Stadiums</li>\r\n	<li>Educational facilities</li>\r\n	<li>Hotels, convention centers and office buildings/complexes</li>\r\n	<li>Entertainment venues</li>\r\n	<li>Warehouses and production floors</li>\r\n</ul>', '<p><strong>OSID Features&nbsp;and&nbsp;Benefits</strong></p>\r\n\r\n<p>OSID&rsquo;s uncompromising performance is based on the patented use of digital imaging, dual-frequency beams and smart algorithms delivering:</p>\r\n\r\n<ul>\r\n	<li>Patented dual wavelength, UV &amp; IR, particle detection</li>\r\n	<li>CMOS Imager with wide viewing angles</li>\r\n	<li>Simple installation, commissioning and maintenance</li>\r\n	<li>High tolerance to vibration and structural movement</li>\r\n	<li>High&nbsp;tolerance to dust, fogging, steam, reflections and object intrusion</li>\r\n	<li>High resistance to reflected sunlight</li>\r\n	<li>On-board log memory</li>\r\n	<li>Software tool for diagnostic purposes</li>\r\n	<li>Aesthetically discreet and 3D coverage</li>\r\n	<li>Long range up to 150 m. (492 ft.) with minimal free space (&Oslash;15 cm./5.85&rdquo;)</li>\r\n</ul>', '<p><strong>OSID vs. Beam, Heat and Flame Detectors&nbsp;</strong><br />\r\nBeam, heat and flame detectors are commonly used in open spaces for fire detection but have proved problematic. Beam detectors are susceptible to building movement and prone to false alarms due to dust, condensation and object intrusion. They also are difficult to align and therefore time consuming to install. While offering higher reliability, heat and flame detectors only detect&nbsp;fire in the developed, flaming stage, which negates early detection and results in threats to life safety and major property damage. OSID overcomes all of the shortcomings inherent to these systems.</p>\r\n\r\n<p><strong>3-D Volumetric Coverage&nbsp;</strong><br />\r\nA significant benefit of OSID is its ability to provide volumetric coverage. As many as seven emitters can be placed within the field of view of a single imager, each placed at different heights. The OSID imager&#39;s large viewing angles, both horizontal and vertical,&nbsp;enable three-dimensional area coverage for design flexibility and additional deployment savings.&nbsp;Unlike other volumetric technologies, OSID delivers absolute calibration for consistent detection performance regardless of lighting conditions, smoke color, airflows or other environmental conditions.</p>', NULL, 'images/Products/1544089364.jpg', 'images/Products/15440893642.png', 'images/Products/15440893643.jpg', NULL, 1, 3, '2018-12-06 03:42:44', '2018-12-06 03:42:44'),
(27, 'Wi-Fi Home Security Camera', 9, 'JH09 3G', 'wi-fi-home-security-camera-bzG', NULL, NULL, '<p><strong>Wi-Fi Home Security Alarm Camera System</strong></p>\r\n\r\n<p>Keeping an eye on your home is simple, even thousands of miles away. Just hook up the 3G Wi-Fi Camera (&nbsp;<strong>JH09</strong>&nbsp;) and leave it running. You can check at any time through your smartphone to monitor your house and you can relax in the knowledge that should anyone break in you&#39;ll instantly be alerted with frame grabs of the intruders sent to your mobile. In peace of mind you could check what is happening in the house through 720P live video stream. Even when the power is cut off, the internal battery is ready for up to 4 hours&rsquo; usage to detect abnormal motion aided by the PIR sensor.</p>', NULL, '<ul>\r\n	<li>&nbsp;<strong>&nbsp;&nbsp;</strong><strong>Quick &amp; Easy Set Up</strong></li>\r\n</ul>\r\n\r\n<p>It only takes you a moment to set up the device.No complex router configuration and technical skills needed. The stand/wall mount holds the camera securely in place</p>\r\n\r\n<ul>\r\n	<li>&nbsp;<strong>&nbsp;&nbsp;</strong><strong>3G &amp;WiFi Available</strong></li>\r\n</ul>\r\n\r\n<p>Compatible with latest 3G and Wi-Fi technology, youcan access live video stream or recorded footage from anywhere any time, using our free mobile IOS &amp; Android apps</p>\r\n\r\n<ul>\r\n	<li>&nbsp;<strong>&nbsp;&nbsp;720P Live Video</strong></li>\r\n</ul>\r\n\r\n<p>See and hear your zone with HD 720Pframe grabs loaded with fantastic color representation, great night vision and fantastic audio clarity.</p>\r\n\r\n<ul>\r\n	<li>&nbsp;<strong>&nbsp;&nbsp;</strong><strong>Infrared Detection</strong></li>\r\n</ul>\r\n\r\n<p>Any movements can be detected. As soon as something abnormal happens, the device will send alert message to you in no time.</p>', '<p>1. All products have been strictly Quality Checked in house before packing.</p>\r\n\r\n<p>2. All products have been well packed before shipping.</p>\r\n\r\n<p>3. One year warranty is provided for all models. We will bear maintenance cost during warranty.</p>', 'images/Products/1544090671.jpg', 'images/Products/15440908832.jpg', 'images/Products/15440906713.jpg', NULL, 1, 20, '2018-12-06 04:04:31', '2018-12-06 04:09:03');
INSERT INTO `projects` (`id`, `project_type_id`, `brand_id`, `title`, `slug`, `introduction`, `provided`, `challanges_overcome`, `status`, `created_at`, `updated_at`) VALUES
(7, 3, 11, 'GTCL DR', 'gtcl-data-recovery-center', '<p><strong>Date Center Size:&nbsp;</strong>Server Room &amp; Power Room <strong>450sft</strong>(Approx.)</p>\r\n\r\n<p><strong>ECL Scope of works:</strong></p>\r\n\r\n<ul>\r\n	<li>Civil works including fire protected Epoxy Paint,Fire Rated Glass Doors</li>\r\n	<li>Ladder for Power &nbsp;Connectivity</li>\r\n	<li>Raised floor &amp; Pannel</li>\r\n	<li><strong>Electrical Infrastructure: </strong>Electrical cabling,MD Box,Circuit Breaker,Supply,Installation &amp; Commission of online UPS,AVR,SPD &amp; Generator including power management of DR.</li>\r\n	<li>Earthing System with installation for Data Center</li>\r\n	<li>Environment Monitoring System for Data Center</li>\r\n	<li>Supply,Installation &amp; Commission of&nbsp;Precision Air Conditioning &amp; Comfort Air Conditioning including Cooling management system.</li>\r\n	<li>Auto Fire Detection and Suppression System</li>\r\n	<li>Very Early Smoke Detection Apparatus (VESDA) for Data Center</li>\r\n	<li>Rodent System for pest controlling</li>\r\n	<li>Surveillance system for Data Center (IP Camera) Including Monitoring software</li>\r\n	<li>Access Control System for Datacenter Including Monitoring software</li>\r\n	<li>Rack mountable Server for Access Control &amp; IP Camera Monitoring</li>\r\n	<li>Two (02) Post Open Rack (42 Rack Unit)</li>\r\n	<li>Passive LAN Cabling</li>\r\n	<li>24/7 Support Service &amp; Maintenance</li>\r\n</ul>', NULL, NULL, 1, '2019-01-30 05:21:35', '2019-01-31 10:59:08'),
(8, 3, 10, 'EGCB DC', 'end-user-training', '<p><strong>Date Center Size:&nbsp;</strong>Server Room &amp; Power Room <strong>380sft</strong>(Approx.)</p>\r\n\r\n<p><strong>ECL Scope of works:</strong></p>\r\n\r\n<ul>\r\n	<li>Civil works including fire protected Epoxy Paint,Fire Rated Glass Doors</li>\r\n	<li>Ladder for Power &nbsp;Connectivity</li>\r\n	<li>Raised floor &amp; Pannel</li>\r\n	<li><strong>Electrical Infrastructure: </strong>Electrical cabling,MD Box,Circuit Breaker,Supply,Installation &amp; Commission of online UPS,AVR,SPD &amp; Generator including power management of DR.</li>\r\n	<li>Earthing System with installation for Data Center</li>\r\n	<li>Environment Monitoring System for Data Center</li>\r\n	<li>Supply,Installation &amp; Commission of&nbsp;Precision Air Conditioning &amp; Comfort Air Conditioning including Cooling management system.</li>\r\n	<li>Auto Fire Detection and Suppression System</li>\r\n	<li>Very Early Smoke Detection Apparatus (VESDA) for Data Center</li>\r\n	<li>Rodent System for pest controlling</li>\r\n	<li>Surveillance system for Data Center (IP Camera) Including Monitoring software</li>\r\n	<li>Access Control System for Datacenter Including Monitoring software</li>\r\n	<li>Rack mountable Server for Access Control &amp; IP Camera Monitoring</li>\r\n	<li>Cooling Containment &amp; Server Rack with IP KVM and Console</li>\r\n	<li>Passive LAN Cabling</li>\r\n	<li>24/7 Support Service &amp; Maintenance</li>\r\n</ul>', NULL, NULL, 1, '2019-01-30 05:24:27', '2019-01-31 10:59:21'),
(9, 4, 12, 'NWPGCL IP Survialance:', 'nwpgcl-ip-survialance:', '<p>We provided-</p>\r\n\r\n<ul>\r\n	<li>Optical Fiber Connectivity for long remote connectivity</li>\r\n	<li>Category 6 UTP Cable and Accessories</li>\r\n	<li>Layard Power Cable to Power Outlet</li>\r\n	<li>EarthLink ensure for each camera</li>\r\n	<li>Separate and dedicated Metallic Pole and Safety Equipment Box</li>\r\n	<li>4 Megapixel Pan-Tile-Zoom enabled Speed Dome IP Camera</li>\r\n	<li>Hi performance Gigabit Network Switch</li>\r\n	<li>Gigabit Media Converter for Single Camera Connectivity</li>\r\n	<li>Hi Performance Network Video Recorder</li>\r\n	<li>Competitively Price</li>\r\n	<li>24/7 Support Service &amp; Maintenance</li>\r\n</ul>', NULL, NULL, 1, '2019-01-31 11:18:55', '2019-01-31 11:18:55'),
(10, 5, 11, 'GTCL Infrastructure Integration', 'gtcl-infrastructure-integration', '<p>ECL Systems Provided:</p>\r\n\r\n<ul>\r\n	<li><strong>LAN:</strong>Local area connection of GTCL Head Office &amp; their 15 regional offices across Bangladesh.</li>\r\n	<li>\r\n	<p>&nbsp;<strong>Access Control:</strong> Supply, Installation &amp; Implementation of Biometric attendance systems for all GTCL&rsquo;s officials at their HQ &amp; 15 regional offices.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Network Analyzer:</strong> Supply, Installation &amp; Implementation of CISCO NetFlow for GTCL Network analyze.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>IT Equipments:</strong> Supply &amp; installation of 50Nos Printer &amp; 350Nos 1 KVA online UPS at GTCL Head Office &amp;&nbsp;15 regional offices.</p>\r\n	</li>\r\n</ul>', NULL, NULL, 1, '2019-01-31 12:16:51', '2019-01-31 12:16:51'),
(18, 6, 11, 'GTCL\'s Infrastructure Integration', 'gtcl\'s-infrastructure-integration', '<p>ECL Systems Provided:</p>\r\n\r\n<ul>\r\n	<li><strong>LAN:</strong>Local area connection of GTCL Head Office &amp; their 15 regional offices across Bangladesh.</li>\r\n	<li><strong>Access Control:</strong>&nbsp;Supply, Installation &amp; Implementation of Biometric attendance systems for all GTCL&rsquo;s officials at their HQ &amp; 15 regional offices.</li>\r\n	<li><strong>Network Analyzer:</strong>&nbsp;Supply, Installation &amp; Implementation of CISCO NetFlow for GTCL Network analyze.</li>\r\n	<li><strong>IT Equipments:</strong>&nbsp;Supply &amp; installation of 50Nos Printer &amp; 350Nos 1 KVA online UPS at GTCL Head Office &amp;&nbsp;15 regional offices.</li>\r\n</ul>', NULL, NULL, 1, '2019-01-31 12:45:03', '2019-01-31 12:45:03'),
(19, 7, 11, 'Training on CCNA & Red Hat Certified System Administrator', 'training-on-ccna-&-red-hat-certified-system-administration', '<p>ECL SYSTEMS LTD. conducted GTCL&#39;s 10 Officials CCNA &amp; RHCSA certification training.</p>\r\n\r\n<p><strong>Scope of work for training:</strong></p>\r\n\r\n<ul>\r\n	<li>Training on&nbsp;CISCO Certified Network Associate(CCNA) Routing &amp; Switching composite including theory &amp; laboratory works.Total 80 hours.</li>\r\n	<li>CCNA&nbsp;Routing &amp; Switching composite exam(200-125)</li>\r\n	<li>Training on Red Hat Enterprise Linux 7 version&nbsp;including theory &amp; laboratory works.Total 90 hours.</li>\r\n	<li>Red Hat Certified System Administrator(RHCSA) exam(EX200)</li>\r\n</ul>\r\n\r\n<ul>\r\n</ul>', '<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>', NULL, 1, '2019-02-11 09:56:18', '2019-02-11 09:58:21'),
(20, 7, 11, 'PC Skill Training', 'pc-skill-training', '<p>ECL SYSTEMS LTD. conducted GTCL&#39;s 363 Officials PC Skill Training to operate &#39;SAP ERP&#39; at GTCL HQ &amp; 15 regional offices.</p>\r\n\r\n<p><strong>Scope of work for training:</strong></p>\r\n\r\n<ul>\r\n	<li>User training on Microsoft Outlook 2016</li>\r\n	<li>Microsoft Lync Basic 2013</li>\r\n	<li>Microsoft SharePoint 2016</li>\r\n	<li>Trouble Ticketing on&nbsp;SAP</li>\r\n	<li>Per Batch 12 Hours,Total 132 hours</li>\r\n	<li>Theory &amp; laboratory works</li>\r\n</ul>', NULL, NULL, 1, '2019-02-11 10:10:09', '2019-02-11 12:25:36'),
(21, 7, 10, 'Training & Certification on CDCP & CDCS', 'training-&-certification-on-cdcp-&-cdcs', '<p>ECL SYSTEMS LTD. conducted EGCB&#39;s 3 Officials <strong>CDCP &amp; CDCS</strong> certification training at EPI, Thailand.</p>\r\n\r\n<p><strong>Scope of work for training:</strong></p>\r\n\r\n<ul>\r\n	<li>Training on CDCP-Certified Data Centre Professional&nbsp;including theory &amp; laboratory works as per EPI Syllabus.</li>\r\n	<li>CDCP-Certified Data Centre Professional exam</li>\r\n	<li>Training on CDCS-Certified Data Centre Specialist including theory &amp; laboratory works as per EPI Syllabus.</li>\r\n	<li>CDCS-Certified Data Centre Specialist&nbsp; exam</li>\r\n</ul>', NULL, NULL, 1, '2019-02-11 10:22:28', '2019-02-11 10:22:28'),
(22, 6, 10, 'Supply of IT Equipments', 'supply-of-it-equipments', '<p>ECL Systems supplied &amp; installation of:</p>\r\n\r\n<ul>\r\n	<li>Blue Coat Band Width Manager</li>\r\n	<li>50pcs HP Desktop Computer</li>\r\n	<li>20pcs HP Laptop</li>\r\n	<li>04pcs&nbsp;Heavy Duty Laser Printer</li>\r\n	<li>10pcs Regular Printer &amp; Scanner</li>\r\n	<li>Projector</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, 1, '2019-02-11 12:20:52', '2019-02-11 12:23:57');
