(3, 5, '<p>To setup a standard infrastructure for Implementation of Enterprise Resource Planning (ERP) and Enterprise Assets Management (EAM) System, the <strong>FPT information system</strong> (a VIETNAM based Company) Signed contracts with <strong>GTCL</strong> &amp; <strong>EGCB</strong>; and we the <strong>ECL Systems Ltd.</strong> work with FPT information system as a local partner to implement and setup the DR infrastructure at GTCL Demra Office &amp; EGCB Head Office.</p>', 'images/Successful-Cases/1548825580.jpg', 'images/Successful-Cases/15488255801.jpg', 'images/Successful-Cases/1549886946.jpg', 'images/Successful-Cases/15488255803.jpg', '2019-01-30 05:19:40', '2019-02-11 12:09:06'),
(4, 3, '<p><strong>North-West Power Generation Co. Ltd. (NWPGCL)</strong> focused on enhanced security solutions and Integrated Security Surveillance Networks for their 4 power generation plant at different geographical location in Bangladesh.</p>', 'images/Successful-Cases/1548933308.jpg', 'images/Successful-Cases/1549881056.jpg', 'images/Successful-Cases/1549881038.jpg', 'images/Successful-Cases/1549880987.jpg', '2019-01-31 11:15:08', '2019-02-11 10:30:56'),
(6, 14, '<p>To setup a standard infrastructure for Implementation of Enterprise Resource Planning (ERP &amp; EAM) System, the&nbsp;<strong>FPT information system</strong>&nbsp;(a VIETNAM based Company) Signed a contract&nbsp;with&nbsp;<strong>GTCL</strong>&nbsp;where&nbsp;<strong>ECL Systems Ltd.</strong>&nbsp;work with FPT information system as a local partner to connect&nbsp;and integrate&nbsp;<strong>GTCL&#39;s 15 regional offices</strong>&nbsp;with their Head Office.</p>', 'images/Successful-Cases/1548938257.jpg', 'images/Successful-Cases/1549885887.jpg', 'images/Successful-Cases/15489382572.jpg', 'images/Successful-Cases/15489382573.png', '2019-01-31 12:37:37', '2019-02-11 11:51:27'),
(7, 15, '<p>ECL SYSTEMS LTD. has conducted various certifications &amp; skill development training of&nbsp;different Goverment Organization&#39;s officials at Bangladesh &amp; abroad.</p>', 'images/Successful-Cases/1549869109.jpeg', 'images/Successful-Cases/1550569816.jpg', 'images/Successful-Cases/1549880870.jpg', 'images/Successful-Cases/1549885446.jpg', '2019-02-09 08:34:10', '2019-02-19 09:50:16');
INSERT INTO `services` (`id`, `name`, `is_trining`, `color`, `background_color`, `slug`, `short_des`, `description`, `image`, `status`, `priority`, `created_at`, `updated_at`) VALUES
(3, 'IP CCTV Video Survialance', 0, '#000000', '#a4d1ff', 'ip-cctv-video-survialance', 'Network infrastructure is typically part of the IT infrastructure found in most enterprise IT environments.', '<p>Are you looking for professional IP CCTV security with IP cameras as a part of your security solution?</p>\r\n\r\n<p><strong>We ECL system can help you with implementation of best IP CCTV security system.</strong></p>\r\n\r\n<p>We are professional as an installer of world class IP CCTV system with outstanding technical support.&nbsp; We can give you both sales and pre-sales support as a reliable supplier of IP CCTV camera surveillance system installation and integration in Bangladesh.</p>\r\n\r\n<p>Our Specialties in terms of IP CCTV Security System:</p>\r\n\r\n<ul>\r\n	<li>Extensive Experience in Designing a Proper IP CCTV Security System</li>\r\n	<li>Consultancy Service for CCTV installations</li>\r\n	<li>Professional installation of the CCTV system</li>\r\n	<li>24/7 Technical Support</li>\r\n	<li>Working with Global Vendors</li>\r\n	<li>Certified Engineers</li>\r\n</ul>\r\n\r\n<p><strong>Modern Development of Surveillancy &amp; Intelligent Solutions:</strong></p>\r\n\r\n<p>The role played by surveillance camera in recent past has been immense with the rise in global threats; some government in many countries have made CCTV mandatory at the working premises.&nbsp; The companies not only require surveillance to safe guard their assets but use it as evidence that can be presented at courts of law.&nbsp; This has pushed the limits of the technology involved in the design and techniques of video surveillance.</p>\r\n\r\n<p><strong>System Integration with other system:</strong></p>\r\n\r\n<p>Our IP CCTV surveillance can be integrated with other systems in creating a strong, unique and centralized CCTV solution. Surveillance system are often integrated with access control systems that can be designed and installed in a techniq1ue that it works on its own. IP based CCTV system integration helps in a centralized system that could be both controlled and monitored from various locations in a single premise or to connect many locations across the country that are in remote locations. The monitoring of premises in a variety of locations can be setup at the head office with a greater control of operations.</p>', 'images/Services/1548071717.jpg', 1, 5, '2018-07-29 05:55:26', '2019-02-11 10:47:18'),
(4, 'Cyber Threat Protection', 0, '#000000', '#84c1ff', 'cyber-threat-protection', 'Cyber security awareness is at an all-time high. Cyber threat is one of the most serious economic security challenges and economic prosperity depends on cyber security. It seems as though every day a shadowy organization makes cyber security threats and that these threats result in more and more cyber security attacks on enterprises, resulting in loss of confidential data, trust and money.\r\n\r\nCyber security is the set of \"measures taken to protect a computer or computer system (as on the internet) against unauthorized access or attack.\" This broad and all-encompassing cyber security definition poses a significant challenge for enterprises; therefore, it is highly critical for enterprises to have an in-depth cyber security strategy and plan in place in order to provide the maximum level of protection from cyber security risks at not just the network perimeter but also the application layer.', '<p>Cyber security awareness is at an all-time high. Cyber threat is one of the most serious economic security challenges and economic prosperity depends on cyber security. It seems as though every day a shadowy organization makes cyber security threats and that these threats result in more and more cyber security attacks on enterprises, resulting in loss of confidential data, trust and money.</p>\r\n\r\n<p>Cyber security is the set of &quot;measures taken to protect a computer or computer system (as on the internet) against unauthorized access or attack.&quot; This broad and all-encompassing cyber security definition poses a significant challenge for enterprises; therefore, it is highly critical for enterprises to have an in-depth cyber security strategy and plan in place in order to provide the maximum level of protection from cyber security risks at not just the network perimeter but also the application layer.</p>\r\n\r\n<p>We the <strong>ECL Systems Ltd.</strong> help customer to create an agile and predictive cybersecurity posture to mitigate cyber risks in today&rsquo;s IT environment. To combat today&rsquo;s sophisticated cyberattacks and meet organizational needs, you&rsquo;ll need a multilayered approach to threat prevention. <strong>ECL</strong>s solutions enable detection and prevention of known vulnerabilities and advanced threats through multiple mechanisms: dedicated threat prevention appliances or specialized Software Blades.</p>\r\n\r\n<p>By integrating business context intelligence, threat data and cyber insights from its team of specialized analysts, Paladion provides a complete spectrum of information risk management comprising of security assurance, governance, vulnerability management, monitoring, and security analytics to large and medium-sized organizations. To accomplish this, we provide the following services:<br />\r\n<br />\r\nIn the managed service mode, we provide remote or onsite management to bring the benefit of established, proven technologies and processes rather than trying to build it yourself.</p>\r\n\r\n<ul>\r\n	<li>Captive</li>\r\n	<li>On Premise</li>\r\n	<li>MSSP</li>\r\n	<li>CyberActiveCloudOps</li>\r\n	<li>CyberActive SOC</li>\r\n	<li>CyberActive VM</li>\r\n	<li>CyberActive GRC</li>\r\n	<li>CyberActive for DevOps</li>\r\n	<li>CyberActive SOC for ArcSight</li>\r\n	<li>CyberActive SOC for QRadar</li>\r\n</ul>\r\n\r\n<p><strong>Our solutions global partner:</strong></p>\r\n\r\n<p><a href=\"http://www.paladion.net\">Paladion USA</a></p>', 'images/Services/1548069510.jpg', 1, 6, '2018-08-05 05:38:37', '2019-02-11 11:40:40'),
(5, 'Datacenter Solution', 0, '#000000', '#bf80ff', 'datacenter-solution', 'Today, Enterprise IT departments are trapped between competing demands to reduce running costs while also supporting new business models and creating new ways for customers to interact with the business.', '<p>Today, Enterprise IT department are trapped between competing demands to reduce running costs while also supporting new business models and creating new ways for customers to interact with the business. In the current scheme of market dynamics, time is to change the datacenter from something static and fixed and relatively expensive, to something that is highly automated, dynamic and very cost effective.&nbsp; What is required is large scale automation and dramatically higher levels of operational efficiency within datacenter.</p>\r\n\r\n<p><strong>ECL System Ltd.</strong> Offers Datacenter building solutions in partnership with global technology leaders like Cisco IBM, Emerson, APC, and Schneider etc.</p>\r\n\r\n<p><strong>ECL Offers:</strong></p>\r\n\r\n<ul>\r\n	<li>Assessment of sites and requirements</li>\r\n	<li>Risk Evaluations</li>\r\n	<li>Consultancy and design architecture</li>\r\n	<li>RFP and RFQ creation</li>\r\n	<li>BCP &amp; DR recommendations</li>\r\n	<li>Execution and Support</li>\r\n	<li>Installation and integration of\r\n	<ul>\r\n		<li>Electricals,</li>\r\n		<li>Precision Air Conditio0ning</li>\r\n		<li>Access Control</li>\r\n		<li>Fire Alarm etc.</li>\r\n		<li>EMS</li>\r\n		<li>IP CCTV &amp; Security</li>\r\n	</ul>\r\n	</li>\r\n	<li>Relocation/ Consolidation of DC</li>\r\n	<li>We simplify data center operations, accelerate deployment, and reduce your costs with the industry standard data center architecture.</li>\r\n	<li>We enable your applications run faster in bare-metal, virtualized, and cloud computing environments.&nbsp; Our solutions include computing, unified network architecture comprising of data center switching &amp; security for more efficient operations and greater scalability.</li>\r\n	<li>We enable architecture that supports common policy framework to automate provisioning, rapid application changes and management of resources. ECL expertise includes converged and hyper converged infrastructure solution.</li>\r\n</ul>\r\n\r\n<p>A datacenter without effective and optimized Active/Passive Networking is not complete.&nbsp; ECL offers an end-to-end network solution from its conception to its successful completion.</p>\r\n\r\n<p><strong>We are expertise in following:</strong></p>\r\n\r\n<ul>\r\n	<li>Wireless communication</li>\r\n	<li>Unified Communication &amp; Collaboration</li>\r\n	<li>Network Security</li>\r\n	<li>Routing and Switching</li>\r\n</ul>', 'images/Services/1547976025.jpg', 1, 1, '2018-08-05 05:52:12', '2019-02-11 10:41:47'),
(6, 'Internet of Things', 0, '#000000', '#d9b3ff', 'internet-of-things', 'The Internet of Things (IoT) refers to a system of interrelated, internet-connected objects able to collect and transfer data over a wireless network without human intervention.', '<p>The Internet of Things (loT) refers to a system of interrelated, internet-connected objects able to collect and transfer data over a wireless network without human intervention.</p>\r\n\r\n<p>Today, business is lot-motivated by the prospects of increasing revenue or reducing operating costs by improving efficiencies.</p>\r\n\r\n<p>We, <strong>ECL Systems Ltd. </strong>Provide end-to-end loT Solutions that can be tailored for any need, helping making informed decisions, optimize operations, reduce costs and create new revenue streams.</p>\r\n\r\n<p>Our loT Application Platform catered to the world of residential smart-connected living. Designed for home owners, residents, developers, operators and much more.</p>\r\n\r\n<p>You can increase productivity and operational efficiencies. From security management to meeting room automation, cannot any device to control with voice, gesture or Smartphone. It can be installed in new commercial development or into any office space.</p>\r\n\r\n<p><strong>Home &amp; Office Automation</strong></p>\r\n\r\n<p>Build you own sanctuary. From traditional homes to modern developments, we have various technology solutions to fulfill every home owner&rsquo;s idea of a safe haven.</p>\r\n\r\n<p>An ideal Home Automation system provides:</p>\r\n\r\n<ul>\r\n	<li>Unlocking the door</li>\r\n	<li>Switching on the lights and appliances</li>\r\n	<li>Bar uninvited guests at home by Access Control</li>\r\n	<li>Sensors at doors, windows &amp; AC</li>\r\n	<li>24/7 Surveillance System at your hand</li>\r\n</ul>\r\n\r\n<p>All the Preventive measures above are designed to further reduce the risk of intrusion and burglary</p>\r\n\r\n<p><strong>Our solutions global partner: </strong>&nbsp;</p>\r\n\r\n<p><a href=\"http://www.variantz.com\">Variantz Asia Pacific Pte. Ltd.</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'images/Services/1548069696.jpg', 1, 4, '2018-08-05 05:59:00', '2019-02-11 11:37:27'),
(10, 'Network Security & Integration', 0, '#000000', '#c1c1ff', 'network-security-&-integration', 'Network down-time or poor quality of service today directly translates into revenue losses for an enterprise today.', '<p>Network down-time or poor quality of service today directly translates into revenue losses for an enterprise today. Network security and integration is a function of multiple layers of defenses in the network and at the network.</p>\r\n\r\n<p>When you need network security and integration solutions tailored to your company&rsquo;s requirements, turn to <strong>ECL Systems Ltd</strong>. We can work with your building owners, architects, and additional staff to design custom made systems that work with your property&rsquo;s specifications. From card access systems to audio/visual solutions, we can provide a variety of services and integrate them to run from a single operating point. We can supply:</p>\r\n\r\n<ul>\r\n	<li>Voice, Data and Access control Solutions</li>\r\n	<li>Card access systems</li>\r\n	<li>Video Surveillance Systems</li>\r\n	<li>DVR Solutions</li>\r\n	<li>Audio/Visual solutions</li>\r\n	<li>Smart board technology</li>\r\n	<li>Biometrics</li>\r\n	<li>Security Systems</li>\r\n	<li>Mass notification systems</li>\r\n	<li>Data/Network Infrastructure Solutions include</li>\r\n	<li>Firewalls</li>\r\n	<li>Wed content filtering</li>\r\n	<li>Anti-virus solutions</li>\r\n	<li>Switching</li>\r\n	<li>Intrusion Prevention and Detection services</li>\r\n</ul>\r\n\r\n<p><strong>NETWORK SECURITY</strong></p>\r\n\r\n<ul>\r\n	<li>Unified Threat Management (UTM)</li>\r\n	<li>Next-Generation Firewall (NGFW)</li>\r\n	<li>Secure Wi-Fi</li>\r\n	<li>Network Visibility</li>\r\n</ul>\r\n\r\n<p><strong>TOP SECURITY THREATS </strong></p>\r\n\r\n<ul>\r\n	<li>Advanced Malware</li>\r\n	<li>Unsecured Wireless Networks</li>\r\n	<li>Networks Blind Spots</li>\r\n	<li>Data loss</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'images/Services/1548069527.jpg', 1, 7, '2018-09-26 03:03:59', '2019-02-11 11:48:43'),
(12, 'Service & Maintenance', 0, '#000000', '#9595ff', 'service-&-maintenance', 'Maintenance, Repair and Refurbishment (MRR) involves fixing any sort of IT Infrastructure & Equipment should it become out of order. It also includes performing routine actions that keep the Network in working order and prevent trouble from arising. MRR defines as, “All actions which have the objective of retaining or restoring an item in or to a state in which it can perform its required function. This includes the combination of all technical and corresponding administrative, managerial, and supervising actions.” Without both support and maintenance, whether conducted in or out, organizations might be planning to fail in their stipulated ICT Service. This could lead to lengthy business outages and loss of business revenue. ECL Systems Ltd. offering Service Letter Agreement/Maintenance Service Agreement.', '<p>Maintenance, Repair and Refurbishment (MRR) involves fixing any sort of IT Infrastructure &amp; Equipment should it become out of order. It also includes performing routine actions that keep the Network in working order and prevent trouble from arising.Without both support and maintenance, whether conducted in or out, organizations might be planning to fail in their stipulated ICT Service. This could lead to lengthy business outages and loss of business revenue. ECL Systems Ltd. offering Service Letter Agreement.</p>\r\n\r\n<p><strong>Service Level Agreement (SLA)</strong> is an agreement or contract between an organization and their service provider that details the obligations and expectations of the relationship. <strong>Working with ECL Systems Ltd. has many benefits</strong>. The <strong>SLA</strong>&nbsp;functions as a blueprint of the service, ECL will provide, and can protect your organization&#39;s ICT Communication Network and business plunge. Below we&rsquo;ve provided the reasons why your organization should have an <strong>SLA</strong> with us-</p>\r\n\r\n<p>We Sets Clear and Measurable Guidelines</p>\r\n\r\n<p>An SLA is key to ensure you and ECL is on the same page in terms of standards and service. Establishing clear and measurable guidelines are important as it reduces the chances of disappointing you and provides you with recourse if obligations aren&rsquo;t met.</p>\r\n\r\n<p><strong>We Provides Recourse for Unmet Service Obligations</strong></p>\r\n\r\n<p>If ECL fails to meet our obligations, there can be significant consequences for your organization&#39;s reputation and bottom line. In SLA, you and ECL would be a chance to include consequences if performance standards are not met. These monetary penalties may be able to assist your organization if losses are incurred. It also protects your organization and holds us accountable.</p>\r\n\r\n<p><strong>We keep you Peace of Mind</strong></p>\r\n\r\n<p>ECLs <strong>SLA</strong> can provide peace of mind to you and your enterprise. We will provide you assurance regarding the service as in the agreement and keep you <strong>Peace of Mind</strong>.</p>\r\n\r\n<p><strong>We review the contract</strong></p>\r\n\r\n<p>An SLA is key in protecting your organization and ensures you have a successful relationship with your provider. Any service provider you choose should be more than happy to create an SLA with you. However, having an <strong>SLA</strong> isn&rsquo;t enough. Always remember to review the contract as your business grows or changes. Your needs may change over time and your SLA should always reflect your organization&#39;s evolving needs. <strong>ECL</strong> always go through mutual understanding in terms of performance standards are important to establish a positive experience for all involved parties as a technology group with time.</p>', 'images/Services/1548069260.png', 1, 8, '2018-11-28 02:42:46', '2019-02-11 11:07:09'),
(13, 'Integrated Security Solution', 0, '#000000', '#cf9fff', 'integrated-security-solution', 'Designed for commercial and residential surveillance, these provide 960H quality images that will help to service your safety requirements', '<p>As a supplier, Vendor and reseller we offer:</p>\r\n\r\n<p><strong>Intelligent IP CCTV System</strong></p>\r\n\r\n<p>Designed for commercial and residential surveillance, these provide 960H quality images that will help to service your safety requirements. Whether it is the analogue closedcircuit television of digital internet protocol version, we have a range of high definition models &amp; Brands available to suit your surveillance and security requirements. With HD, you get the high-quality images including provide 720P and 1080P. We provide.</p>\r\n\r\n<ul>\r\n	<li>Analog System including Dome &amp; Bullet camera</li>\r\n	<li>Internet Protocol (IP) System</li>\r\n	<li>Hybrid System (Analog &amp; IP) System</li>\r\n	<li>Surveillance Management System</li>\r\n</ul>\r\n\r\n<p><strong>Perimeter Intrusion Detector/Motion Detector </strong></p>\r\n\r\n<p>Intrusion detection-an electronic fence&rdquo;- in combination with alarm verification &ndash; video surveillance- protects property and prevents sabotage. Technologies from Xtralis anticipate disasters by giving users time to responds before life, critical infrastructures or business continuity is compromised.</p>\r\n\r\n<p><strong>Access Control</strong></p>\r\n\r\n<p>Access Control Solution has become on of the most inevitable security solutions. From employee safety to building security to protecting your business assets, the security system in place may very for every company due to the different needs and complexity. In order for us to help gauge and better customize the solutions. Do get in touch for a further discussion. We provide.</p>\r\n\r\n<ul>\r\n	<li>Facial Recognition</li>\r\n	<li>Biometric Fingerprint</li>\r\n	<li>Biometric Finger vein</li>\r\n	<li>Card Access</li>\r\n	<li>Keypad Access</li>\r\n	<li>Flush Mounting Design</li>\r\n</ul>\r\n\r\n<p><strong>Relevant Access Control Solutions </strong></p>\r\n\r\n<ul>\r\n	<li>Car-park Management system</li>\r\n	<li>Security Management System</li>\r\n	<li>Auto Gate System</li>\r\n</ul>\r\n\r\n<p>We have a wide variety of access controls of different Global Brands like Anviz, NTI, Honeywell, Maxview SG &amp; etc.</p>\r\n\r\n<p><strong>Time Attendance </strong></p>\r\n\r\n<p>Our Product can support different requirements such as checking punctuality and overtime working hours of employees under contract.</p>\r\n\r\n<p><strong>Turnstile </strong></p>\r\n\r\n<p>As a supplier and reseller, we have a wide variety turnstiles models in Bangladesh, including both half height turnstiles and full height turnstiles.</p>\r\n\r\n<p><strong>Visitor Management System</strong></p>\r\n\r\n<p>We also provide VMS with our Turnstile.</p>\r\n\r\n<p><strong>Smoke &amp; Fire Detection System</strong></p>\r\n\r\n<p>We Provide full range of smoke &amp; fire detection system including Aspiration Smoke Detection, Flame Detector &amp; ECO Gas Detection. We offer a range of solutions for fire safety &amp;securite of data center, commercial offices &amp; factories.</p>\r\n\r\n<p><strong>People Counting System </strong></p>\r\n\r\n<p>The SWE-300 series people counter is the latest model in the thermal array based people counter family, now with IP connectivity, which allows direct connection of the counter to LAN based systems for remote configuration, and data collection using IP infrastructure, and browser based applications, |The SWE-3000 also incorporates an in-built data logger providing a universal people counting detector.</p>\r\n\r\n<ul>\r\n	<li>Applicable variety of counting applications:</li>\r\n	<li>Retail, Shopping Malls &amp; Shops</li>\r\n	<li>Leisure, Hotels &amp; Casinos</li>\r\n	<li>Transportation</li>\r\n	<li>Smart Buildings</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'images/Services/1548153524.jpg', 1, 3, '2019-01-21 10:17:08', '2019-02-11 11:26:56'),
(14, 'Building & Industrial Automation', 0, '#000000', '#dcb9ff', 'building-&-industrial-automation', 'Solutions for Industrial, Commercial and Residential Buildings.We provide the platform & solution for intelligent building system that makes life in the office and home more comfortable.', '<p>Solutions for industrial, commercial and residential buildings.</p>\r\n\r\n<p>We provide the platform &amp; solution for intelligent building system that makes life in the office and home more comfortable.</p>\r\n\r\n<p>We offer solutions for state-of-the-art IP based integrated security systems, access control system, Audio/video intercom system, surveillance system, public address system etc.</p>\r\n\r\n<p>We design, manage and deliver solutions on information display system, communication system, lightning &amp; surge protection, etc. for all types of buildings.</p>\r\n\r\n<p><strong>Security Management</strong></p>\r\n\r\n<p>We are a one-stop security system solution provider. We specialize in CCTV solution, Intrusion Detection systems, Security Management system and Card Access system. We are successful with projects where the customer has very complex, stringent and sophisticated requirement as our hardware and software are designed to meet those requirements.</p>\r\n\r\n<p><strong>Professional Communication</strong></p>\r\n\r\n<p>We cover a wide range of industries providing state-of-the-art IP solution and conventional communication system for various applications. We specialize in intercom systems, Public Address systems &amp; Emergency Evacuation System, Special Telephones, Sounder and Signaling Devices &amp;Conference systems.</p>\r\n\r\n<p><strong>Lightning and Surge Protection</strong></p>\r\n\r\n<p>We provide Lightning and surge protection solutions of the industrial industry. We offer solutions to protect customer&rsquo;s electrical panels, equipment and machinery against transient surges. Out solutions can meet all specific requirements for telecom, oil &amp; gas and petrochemical industries.</p>\r\n\r\n<p><strong>Electricity Management Systems </strong></p>\r\n\r\n<p>Total solution for improving to the electrical efficiency. The product range includes measurement and control equipment, industrial electric protection, power factor compensation and harmonic filtering equipment and AVR, UPS &amp; Battery.</p>\r\n\r\n<p><strong>Car Park Management System</strong></p>\r\n\r\n<p>We offer a range of innovative solutions and a complete package of professional parking management services and products for the international parking industry. All these products are manufactured by Well-known and reputable company.</p>\r\n\r\n<p><strong>Our solutions global partner:</strong></p>\r\n\r\n<p><a href=\"http://isolectra.com.sg/index.php/home\">Isolectra Far East Pte Ltd.</a></p>\r\n\r\n<p>&nbsp;</p>', 'images/Services/1548153479.jpg', 1, 2, '2019-01-22 09:04:09', '2019-02-11 11:23:36'),
(15, 'Training', 1, '#000000', '#ffffff', 'training', 'Plan Your Career, PEER Learning Centre’s very owned tool for students to find the right career, choose one that suits your interests, aptitudes, work-related values, and personality type.', '<p>Education is any kind of knowledge transitioned into learning.</p>\r\n\r\n<p>LIVEWIRE promote niche training in IT, Electronics &amp; Electricals creating experts for emerging technology industries and specialist technology jobs. A part of CADD Centre, which is Asia&#39;s largest CAD/CAM/CAE training institute. LIVEWIRE is present in 100 locations across India and 6 Countries.</p>', 'images/Services/1549699581.jpg', 1, 9, '2019-02-09 08:06:21', '2019-02-09 08:07:19');
